import ReactDOM from 'react-dom';
import ClassesList from './ClassesList';

class Classes extends  React.Component{
    constructor(props){
        super(props);
        this.state = { data: [] };
    }

 

    render(){
        return(
            <div>

            <ClassesList />

            <button className="btn btn-light">ADD</button>
            </div>
        );
    }
}

export default Classes;
